import React from 'react';

const Social = ({ text, link, icon }) => {
    return (
        <div className={`social ${text.toLowerCase()}`}>
            <i className={`fab ${icon}`} />
            <div className="social-name">
                {text}
            </div>
        </div>
    )
}

export default Social;
